import React, { Component } from "react";
import { Route,NavLink,BrowserRouter as Router,Switch} from "react-router-dom";
import Plank from "../dashboard/Plank";
import Article from "../dashboard/Article";
import Notfound from "../dashboard/Notfound";
import Home from "../dashboard/Home";
import Post from "../dashboard/Post";

class Navbar extends Component {
    render() {
      return (


        <Router>
          <div >
            <ul>
            <li>
                  <NavLink  to="/dashboard/home">
                    Home
                  </NavLink>
                </li>
                <li>
                  <NavLink  to="/dashboard/article">
                    Article
                  </NavLink>
                </li>
                <li>
                  <NavLink to="/dashboard/plank">
                  plank
                  </NavLink>
                </li>
                <li>
                  <NavLink to="/dashboard/post">
                  Post
                  </NavLink>
                </li>
              </ul>
              <Switch>

                <Route exact path="/dashboard/home"  render={(props) => (
    <Home {...props} isAuthed={true} />
  )} />
                <Route exact path="/dashboard/plank"  render={(props) => (
    <Plank {...props} isAuthed={true} />
  )} />
                <Route exact path="/dashboard/post"  render={(props) => (
    <Post {...props} isAuthed={true} />
  )} />
                <Route exact apath="/dashboard/article"  render={(props) => (
    <Article {...props} isAuthed={true} />
  )} />
                <Route exact path="/404" component={Notfound} />
              </Switch>
              </div>
      </Router>


      );
    }
  }

export default Navbar;
